import ActionButton from "./components/Button/ActionButton";
import BorderButton from "./components/Button/BorderButton";
import OutlineButton from "./components/Button/OutlineButton";
import Datatable, { Column } from "./components/DataTable/DataTable";
import Indicator from "./components/Indicator/Indicator";

interface Testing {
    label: string;
    description: string;
    created_date: string;
    phone: string;
    old: boolean
}

const rows: Testing[] = [
    { label: 'label 1', description: 'description 1', phone: "0610101010", old: true, created_date: '12/10/12'},
    { label: 'label 2', description: 'description 2', phone: "0610101010", old: true, created_date: '12/10/12'},
    { label: 'label 3', description: 'description 3', phone: "0610101010", old: true, created_date: '12/10/12'},
    { label: 'label 4', description: 'description 4', phone: "0610101010", old: true, created_date: '12/10/12'},
]

const columns: Column<Testing>[] = [
    {
        label: "Label",
        render: (row: Testing) => <p className="font-bold">{row.label}</p>,
    },
    {
        label: "Description",
        render: (row: Testing) => row.description,
    },
    {
        label: "Phone",
        render: (row: Testing) => row.phone ? "exist" : "non",
    },
    {
        label: "Old",
        render: (row: Testing) => row.old ? 'Vrai': 'Faux',
    },
    {
        label: "Created",
        render: (row: Testing) => row.created_date,
    },
    {
        label: "",
        render: (row: Testing) => <button><svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor" className="w-6 h-6"><path strokeLinecap="round" strokeLinejoin="round" d="M6.75 12a.75.75 0 11-1.5 0 .75.75 0 011.5 0zM12.75 12a.75.75 0 11-1.5 0 .75.75 0 011.5 0zM18.75 12a.75.75 0 11-1.5 0 .75.75 0 011.5 0z" /></svg></button>,
        align: "end"
    }
]

export default function App() {

    const handleCheckedRows = (rows: Testing[]) => {
        console.log('updated: ', rows)
    }

    return (
        <div className='h-screen w-screen flex-col items-center justify-center'>

            <div className="h-[64px] bg w-screen flex items-center md:px-12 justify-center md:justify-start border">
                <h1 className="text-xl text-gray-800 font-bold">Template</h1>
            </div>

            <div className="p-6 md:px-12">
                <div className="flex">
                    <h1 className="text-xl md:text-2xl font-bold">Ressource Name</h1>
                </div>

                <div className="mt-6  space-y-2 flex flex-col md:flex-row  md:justify-between mb-6">
                    <div className="flex space-x-2">
                        <BorderButton>
                            <Indicator status="success"/>
                            <p className="ml-2">Active</p>
                        </BorderButton>
                        <BorderButton>
                            <Indicator status="disabled"/>
                            <p className="ml-2">Inactive</p>
                        </BorderButton>
                    </div>
                    <div className="flex space-x-2">
                        <OutlineButton>Export</OutlineButton>
                        <ActionButton>New Ressource</ActionButton>
                    </div>
                </div>

               <Datatable<Testing>
                    rows={rows}
                    columns={columns}
                    handleCheckedRows={handleCheckedRows}
                    searchPlaceholder="Rechercher une ressources..."
                />
            </div>

        </div>
    );
}
